import React from "react";

export default function CartPage(props){
    return(
        <div>
            <div className="bodycartpage" style={{minHeight: "500px"}}>
                <div className="row">
                    <div className="col-8">Product</div>
                    <div className="col-4" style={{borderLeft: "1px solid darkorange"}}>Total</div>
                </div>
            </div>
            <div style={{ bottom:"0px", minHeight:"100px", borderTop: "2px solid darkorange"}} className="footercartpage"></div>
        </div>
    )
}
